import React from 'react'

const information = () => {
  return (
    <div>
      Your business goals include the Internet, but where do you start? With so many competing technologies and companies vying for your attention, the task of bringing your directories to the web may seem daunting. InformationPages understands your concerns and realizes how difficult finding the right partner can be. We can provide a complete Internet directory solution from data conversion to web hosting, allowing you to have a profitable web presence without the need to ramp-up staff to create or maintain it.
    </div>
  )
}

export default information
